.modal__close {
  position: absolute;
  top: 20px;
  right: 40px;
  height: 50px;
  width: 50px;
  background: none;
}
.modal__close:hover {
  transition: all 1s ease;
  transform: rotate(180deg);
}
.modal__close:active {
  border: none;
}
.modal__close::before {
  content: "";
  position: absolute;
  top: 0;
  width: 2px;
  height: 50px;
  background: black;
  transform: rotate(45deg);
  right: 25px;
}
@media (max-width: 425px) {
  .modal__close::before {
    width: 2px;
    height: 35px;
    right: 0;
  }
}
.modal__close::after {
  content: "";
  position: absolute;
  top: 0;
  width: 2px;
  height: 50px;
  background: black;
  transform: rotate(-45deg);
  right: 25px;
}
@media (max-width: 425px) {
  .modal__close::after {
    width: 2px;
    height: 35px;
    right: 0;
  }
}
.popup {
  display: block;
  position: fixed;
}
